Function Invoke-Toast
{
    Param (
        [string]$Title = "Microsoft Endpoint Manager",
        [string]$Message = "This is a test notification"
    )

    # Picture Base64
    # Create the picture object from a base64 code
    $Picture_Base64 = ""
    $HeroImage = "$env:TEMP\HeroPicture.png"
    [byte[]]$Bytes = [convert]::FromBase64String($Picture_Base64)
    [System.IO.File]::WriteAllBytes($HeroImage, $Bytes)
    # Picture Base64 end

    # Toast design
    $Scenario = 'reminder' 
    $Attribution = "University of Dundee"

    [xml]$Toast = @"
    <toast scenario="$Scenario">
	    <visual>
        	<binding template="ToastGeneric">
	        	<image placement="hero" src="$HeroImage"/>		
    		    <text placement="attribution">$Attribution</text>
        		<text>$Title</text>
    	    	<text>$Message</text>		
        	</binding>
    	</visual>
    </toast>
"@
    # Toast design end

    # Set the AppID
    # AppID to use for the toast. We will use PowerShell one
    $AppID = "{1AC14E77-02E7-4E5D-B744-2EB1AE5198B7}\WindowsPowerShell\v1.0\powershell.exe"
    # Set the AppID end

    # Notification area
    # This part allows you to let the notification in the notification area
    $Notifications_Reg = 'HKCU:\SOFTWARE\Microsoft\Windows\CurrentVersion\Notifications\Settings'
    If (!(Test-Path -Path "$Notifications_Reg\$AppID")) 
    {
        New-Item -Path "$Notifications_Reg\$AppID" -Force
        New-ItemProperty -Path "$Notifications_Reg\$AppID" -Name 'ShowInActionCenter' -Value 1 -PropertyType 'DWORD'
    }

    If ((Get-ItemProperty -Path "$Notifications_Reg\$AppID" -Name 'ShowInActionCenter' -ErrorAction SilentlyContinue).ShowInActionCenter -ne '1') 
    {
        New-ItemProperty -Path "$Notifications_Reg\$AppID" -Name 'ShowInActionCenter' -Value 1 -PropertyType 'DWORD' -Force
    }
    # Notification area end	

    # Toast creation and display
    [void][Windows.UI.Notifications.ToastNotificationManager, Windows.UI.Notifications, ContentType = WindowsRuntime]
    [void][Windows.Data.Xml.Dom.XmlDocument, Windows.Data.Xml.Dom.XmlDocument, ContentType = WindowsRuntime]
    $ToastXml = New-Object -TypeName Windows.Data.Xml.Dom.XmlDocument
    $ToastXml.LoadXml($Toast.OuterXml)		
    [Windows.UI.Notifications.ToastNotificationManager]::CreateToastNotifier($AppID).Show($ToastXml)
    # Toast creation and display end

    Write-Host $Message
}

# init
#Add-Type -AssemblyName System.Windows.Forms
#Add-Type -AssemblyName System.Drawing

# Check minimum OS version requirement (1809 or later)
[int]$CurrentBuild = Get-ItemProperty "HKLM:\SOFTWARE\Microsoft\Windows NT\CurrentVersion" -Name "CurrentBuildNumber" | Select-Object -ExpandProperty CurrentBuildNumber
If ($CurrentBuild -notin (17763, 18363, 19041, 19042) -and $CurrentBuild -lt 19043)
{
    Write-Host "Minimum OS version requirement not met"
    Exit 0
}

# Check if Update tools installed
$MSUHT = Get-WmiObject -Class Win32_Product -Filter "Name = 'Microsoft Update Health Tools'" | Select-Object -Property Name, Version, InstallDate, IdentifyingNumber
If ($null -eq $MSUHT)
{
    # Application is missing
    Invoke-Toast -Message "WARNING: Update Tools not found"
    Exit 1
}
Else
{
    # Application is installed - Assuming there's only one entry matching
    $MSUHT = $MSUHT[0]
    $result = [PSCustomObject]@{
        DisplayName    = $MSUHT.Name
        DisplayVersion = $MSUHT.Version
        InstallDate    = ([System.DateTime]::ParseExact($MSUHT.InstallDate, 'yyyyMMdd', $null)).ToString("dd/MM/yyyy")
        GUID           = $MSUHT.IdentifyingNumber
    }
    Invoke-Toast -Message ($result | ConvertTo-Json -Compress)
    Exit 0
}